// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ProductManagement {
    struct Product {
        string batchNumber;
        string productType;
        string origin;
        uint256 productionDate;
        uint256 quantity;
        address currentOwner;
        string status;
    }

    mapping(uint256 => Product) public products;
    uint256 public productCount;

    event ProductCreated(
        uint256 indexed productId,
        string batchNumber,
        address owner
    );
    event StatusUpdated(uint256 indexed productId, string newStatus);
    event OwnershipTransferred(
        uint256 indexed productId,
        address indexed previousOwner,
        address indexed newOwner,
        uint256 quantity
    );

    function createProduct(
        string memory _batchNumber,
        string memory _productType,
        string memory _origin,
        uint256 _productionDate,
        uint256 _quantity
    ) public {
        productCount++;
        products[productCount] = Product(
            _batchNumber,
            _productType,
            _origin,
            _productionDate,
            _quantity,
            msg.sender,
            "Registered"
        );
        emit ProductCreated(productCount, _batchNumber, msg.sender);
    }

    function updateProductStatus(
        uint256 _productId,
        string memory _newStatus
    ) public {
        require(
            products[_productId].currentOwner == msg.sender,
            "Only the current owner can update the status"
        );
        products[_productId].status = _newStatus;
        emit StatusUpdated(_productId, _newStatus);
    }

    function transferOwnership(
        uint256 _productId,
        address _newOwner,
        uint256 _quantity
    ) public {
        require(
            products[_productId].currentOwner == msg.sender,
            "Only the current owner can transfer ownership"
        );
        require(
            _quantity <= products[_productId].quantity,
            "Insufficient quantity"
        );

        products[_productId].quantity -= _quantity;
        emit OwnershipTransferred(_productId, msg.sender, _newOwner, _quantity);

        if (products[_productId].quantity == 0) {
            products[_productId].currentOwner = _newOwner;
        } else {
            // Create a new product for the transferred quantity
            productCount++;
            products[productCount] = Product(
                products[_productId].batchNumber,
                products[_productId].productType,
                products[_productId].origin,
                products[_productId].productionDate,
                _quantity,
                _newOwner,
                products[_productId].status
            );
            emit ProductCreated(
                productCount,
                products[_productId].batchNumber,
                _newOwner
            );
        }
    }

    function getProduct(
        uint256 _productId
    )
        public
        view
        returns (
            string memory,
            string memory,
            string memory,
            uint256,
            uint256,
            address,
            string memory
        )
    {
        Product memory product = products[_productId];
        return (
            product.batchNumber,
            product.productType,
            product.origin,
            product.productionDate,
            product.quantity,
            product.currentOwner,
            product.status
        );
    }
}
